import React, { useState } from 'react';
import { Autocomplete, Option } from 'chakra-ui-simple-autocomplete';

export const Test = () => {
  const [result, setResult] = useState([]);

  return (
    <Box maxW="md">
    <Autocomplete
      options={options}
      result={result}
      setResult={(options: Option[]) => setResult(options)}
      placeholder="Autocomplete"
    />
  </Box>
  )
};
